import React from 'react';
import {View,Text,Component,StyleSheet} from 'react-native'

const items=props=>{
    return(
        <View style={styles.main}>
            <Text>helo pakistan</Text>
        </View>

    );
};
const styles=StyleSheet.create({
    main:{
        backgroundColor:'grey',
        alignItems:'center'
    }

});
export  default items;
